import logo from './logo.svg';
import './App.css';
import { EducationModel } from './model/education';
import { useEffect } from 'react';
import { HeaderModel } from './model/header';
import HomePage from './pages/homePage';
import { ChakraProvider } from '@chakra-ui/react'

function App() {

  //Need to move this code outside of this function and into the useEffect for asynchronous operations
  //check with chatgpt on this
  //tonight's goal is to build the model wrapper for the backend so that the remainder focus is on the frontend
  //ui look


  useEffect(() => {

    const getEducation = async() => {
      let educationModel = new EducationModel()
      let educations = await educationModel.getEducation()
      console.log(educations[0])
    }

    const getHeader = async() => {
      let headerModel = new HeaderModel()
      let header = await headerModel.getHeader()
      console.log(header[0])
    }

    getEducation()
    getHeader()
  }, [])

  return (
    <ChakraProvider>
          <HomePage/>
    </ChakraProvider>
  );
}

export default App;
